sub _recode
{
	my $unknown = $_[0]->{_unknown};

	if ($_[0]->{_from} eq 'INTERNAL') {
    	my $unknown_chr = $from_ucs{$unknown};
    	$unknown_chr = '' unless defined $unknown_chr;
		$_[1] = join ('',
					  map ($from_ucs{$_} || 
						   (exists $from_ucs{$_} ? $from_ucs{$_} :
							$unknown_chr),
						   @{$_[1]}));
    } else {
		unless ($conv_re) {
			$conv_re = qr /[\xa1-\xfe]?./os;
		}

		my @outbuf;
		$_[1] =~ s/($conv_re|.)/
			push @outbuf, ($to_ucs{$1} || 
						   (exists $to_ucs{$1} ?
							0 : $unknown));
			/gsex;

		$_[1] = \@outbuf;
    }

    return 1;
}

